import PropTypes from 'prop-types';
import Button from '../../../../shared/Button/Button';
import { Link } from 'react-router-dom';
import { ROUTES } from '../../../../../config/constants';

const StartBot = props => {
    return (
        <div className='bg-white p-5 rounded'>
            <h2 className='mb-7 text-2xl font-medium text-gray-800'>Start Bot</h2>
            <p className='text-gray-700 text-xl mb-5'>Start our Telegram Bot to receive trade notifications</p>
            <div className='flex justify-center mb-14'>
                <Button type={'link'}>Open Telegram Bot</Button>
            </div>

            <div className='flex justify-center'>
                <Link to={ROUTES.copyTelegramID.path}>
                    <Button type={'primary'} className={'bg-indigo-600 hover:bg-indigo-700'}>
                        Next
                    </Button>
                </Link>
            </div>
        </div>
    );
};

StartBot.propTypes = {};

export default StartBot;
